import github from '../img/github.svg';
import email from '../img/email.svg';
import linkedin from '../img/linkedin.svg';


function Footer() {
    return (
        <footer className="footer">
            <div className="round">
                <a href="https://github.com/jdearden4/"><img src={github}/></a>
                <a href="mailto:jdearden44@gmail.com"><img src={email}/></a>
                <a href="https://www.linkedin.com/in/julia-dearden/"><img src={linkedin}/></a>
            </div>
        </footer>
    )
}
export default Footer;
